import './Register.css'
import React,{useRef,useEffect}from 'react'


export const Register = () => {
    const uname=useRef();
    const email=useRef();
    const phonenumber=useRef();
    const password=useRef();
    const confirmpassword=useRef();


    function handleuname(e){
        if(e.key==='Enter'){
            email.current.focus()
        }
        
    }
    function handleemail(e){
        if(e.key==='Enter'){
            phonenumber.current.focus()
        }
        
    }
    function handlepnumber(e){
        if(e.key==='Enter'){
            password.current.focus()
        }
        
    }
    function handlepassword(e){
        if(e.key==='Enter'){
            confirmpassword.current.focus()
        }
        
    }
    useEffect(()=>{
        uname.current.focus()

    })

  return (
     
    <div className="pt-5">  
            <div className="global-container  main">  
                <div className="card login-form car">  
                    <div className="card-body">  
                        <h3 className="card-title text-center">  Register  </h3>  
                        <div className="card-text">  
                            <form action="/register"  method="post" name="register">  
                                <div className="form-group">  
                                    
                                    <input type="text" name="username" ref={uname} onKeyUp={handleuname} placeholder="Username"className="form-control form-control-sm"  aria-describedby="emailHelp" autoComplete='new-password' required/>  
                                </div>
                                <div className="form-group">  
                                     
                                    <input type="email" name="email" ref={email} onKeyUp={handleemail} placeholder="Email Id" className="form-control form-control-sm"  aria-describedby="emailHelp" autoComplete='new-password' required/>  
                                </div>
                                <div class="form-group">  
                                     
                                    <input type="number" name="phonenumber"ref={phonenumber} onKeyUp={handlepnumber} placeholder="phone Numer" className="form-control form-control-sm" autoComplete='new-password' required />  
                                </div>
                                <div className="form-group">  
                                     
                                    <input type="password" name="password" ref={password}placeholder="Password" onKeyUp={handlepassword} className="form-control form-control-sm"  aria-describedby="emailHelp"/>  
                                </div>
                                <div className="form-group">  
                                    
                                    <input type="password" name="confirmpassword" ref={confirmpassword}  placeholder="Confirm  Password" className="form-control form-control-sm"  aria-describedby="emailHelp"/>  
                                </div>  
                                  
                                <button type="submit" className="btn btn-primary btn-block"> Register </button>  
                                
                                <div className="sign-up">  
                                    Already have an account? <a href="login.html"> Login</a>  
                                </div>  
                            </form>  
                        </div>  
                    </div>  
            </div>  
    </div>
</div>

  )
}
